&quot;Landscapes have a language of their own, expressing the soul of the things, lofty or humble, which constitute them, from the mighty peaks to the smallest of the tiny flowers hidden in the meadow's grass.&quot;

Battakundi, Kaghan Valley, Khyber Pakhtunkhwah


Explored at #97 on 27 July 2012

&quot;The Overture l&quot;
About 5 minutes after the image 'Prelude ll' the sky began to turn a burnished gold colour. The colour changes were so amazing throughout the Sunset Symphony. As many of you know and getting to know a particular location well and photographing it often in different seasons, lighting and conditions will produce those &quot;wow&quot; images we all strive for.
This series has been that &quot;wow&quot; experience for me so far. I shot numerous frames at various settings and have selected my favourites from the evening.
